import React, { Component } from 'react'
import { Jumbotron, Container } from 'react-bootstrap';


export default class HomePage extends Component {
    render() {
        return (
            <Container>
                <Jumbotron>
                    <h1>
                        Carpooling, made easier.
                    </h1>
                </Jumbotron>
            </Container>
        )
    }
}
